import './DropDown.css'

import { useEffect, useState } from 'react';
import axios from 'axios'

function DropDown(props) {

    const [ objects, setObjects ] = useState(null)
    const [ list, setList ] = useState(null)

    useEffect(()=>{
        let form = new FormData
        form.append('return', 'list')
        form.append('model', props.model)
        axios({
            method: 'post',
            url: 'get-model/',
            data: form,
        }).then((response)=>{
            console.log(response)
            setObjects(response.data)
        })

    }, [ props ])

    useEffect(()=>{
        console.log('.drop-down#\\ '+String(props.id))
        let container = document.querySelector('.drop-down#\\ '+String(props.id))
        console.log(container)
    }, [ objects ])

    return (
        <div className='drop-down' id={props.id}>
            <div className='drop-down-header'>
            </div>
            <div className='drop-down-option'>
            </div>
        </div>
    )
}

export default DropDown
